import React, { useRef, useState } from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import "./catSwiper.scss";
import '../../../node_modules/swiper/swiper.scss';
import { EffectCards } from "swiper";


function catSwiper() {

    return (
        <Swiper
            effect={"cards"}
            modules={[EffectCards]}
            className="catSwiper"
        >
            <SwiperSlide>Weeee</SwiperSlide>
            <SwiperSlide>Juhuuuu</SwiperSlide>
            <SwiperSlide>AAAAA</SwiperSlide>
            <SwiperSlide>Teheee</SwiperSlide>
        </Swiper>

    )
}

export default catSwiper;
